css:
@-moz-document domain(animetosho.org) {
html {
    background: #a82221
}
body {
    background: #6d241e;
    color: #fff
}
#topbar_c {
    background: #e8a0a0 url("data:image/jpeg;base64,")
        left top no-repeat;
}
#mtopbar_c {
    background: #6d241e
}
#topbar_title a {
    color: #FFF
}
#topbar_betanote {
    color: #1de313
}
#topbar_time a.feedbacklink {
    color: #fff600
}
#mtopbar #topbar_nav_links a {
    border-color: #b969ab
}
#mtopbar #topbar_nav_links a:hover {
    border-color: #FFF;
    background: #000
}
#userbar {
    background: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAQAAAC1HAwCAAAAC0lEQVQIHWNgSAMAAGkAZ9QfhWEAAAAASUVORK5CYII=)
}
#footer_line {
    border-top-color: #A0A0A0;
    color: #A0A0A0
}
.usernotice_success {
    background-color: #006000;
    color: #C0F0C0;
    border: 1px solid #C0F0C0
}
.usernotice_alert {
    background-color: #604000;
    color: #F0D080;
    border: 1px solid #F0D080
}
.usernotice_error {
    background-color: maroon;
    color: #F0C0C0;
    border: 1px solid #F0C0C0
}
.user_quote {
    border-left-color: #621570
}
.tipnote {
    color: #0cd57d
}
.tipnote:hover {
    border-bottom-color: #48ffc9
}
input.text_error,
textarea.text_error {
    border: 1px solid #463b65;
    color: #FFF;
    background: #410000
}
input.text_error:hover,
textarea.text_error:hover {
    background: #300000;
    border: 1px solid #463b65
}
input.text_error:focus,
textarea.text_error:focus {
    background: #101010;
    border: 1px solid #463b65
}
.uploadfield,
input.text,
select,
textarea {
    border: 1px solid #6e7500;
    background: #000;
    color: #FFF
}
.uploadfield_hover,
input.text:hover,
select:hover,
textarea:hover {
    border: 1px solid #7f8400;
    background: #070707
}
.uploadfield_hover {
    color: #FFF
}
.uploadfield_focus,
input.text:focus,
select:focus,
textarea:focus {
    border: 1px solid #c9cc02;
    background: #101010
}
input.file_error {
    color: #FFF
}
.errortext {
    color: #c10d0d
}
.required_field {
    color: #df7f7f
}
.form_errors {
    background: #3d0000;
    color: #bc0000;
    border: 1px solid #bf0000
}
.comment,
.comment2 {
    border-color: #463b65
}
.comment {
    background-color: #a82221
}
.comment2 {
    background-color: #6d241e
}
.comment_buttons a,
.comment_voting a {
    border-color: #b969ab
}
.comment_buttons a:hover,
.comment_voting a.voted,
.comment_voting a:hover {
    border-color: #FFF!important;
    background: #000
}
.newcomment_placeholder {
    background: #0d0014;
    border-color: #606060
}
.comment_oblivioned {
    color: #F08080
}
h1,
h2 {
    color: #251b1a
}
a {
    color: #70c7ff
}
a:hover {
    color: #cdf0ff
}
a:active,
a:focus {
    color: #629ef8
}
a:visited {
    color: #a579ff
}
.pagination .multipage_current,
.pagination a,
a.pagination {
    border-color: #463b65
}
.pagination .multipage_current,
.pagination a:hover,
a.pagination:hover {
    border-color: #FFF!important;
    background: #000
}
.deadlink,
.deadlink:visited {
    color: #F08080!important
}
.inactivelink {
    color: #707070!important
}
fieldset {
    border-color: #606060
}
th {
    background: #463b65;
    color: #000
}
#ajax_shade {
    background: #000018;
    color: #FFF
}
.home_list_filter {
    border-color: #c23fff
}
.home_list_datesep {
    background: #c23fff;
    color: #000
}
.home_list_entry,
.view_list_entry {
    background-color: #6d241e
}
.home_list_entry_alt,
.view_list_entry_alt {
    background-color: #a82221
}
.home_list_entry_compl_0 {
    background-color: #3c3640
}
.home_list_entry_alt .home_list_entry_compl_0 {
    background-color: #6d241e
}
.home_list_entry_compl_-1 .link a {
    color: grey
}
.home_list_entry_compl_-2 .link a {
    color: #f30000
}
.home_list_entry .links a,
.view_list_entry .links a {
    color: #5088f0
}
.home_list_entry .links a:hover,
.view_list_entry .links a:hover {
    color: #82b1f2
}
.home_list_entry .links a:visited,
.view_list_entry .links a:visited {
    color: #a36af9
}
.dlxlink .linkmenu,
.dlxlink:hover {
    background: #2e023c;
    border-color: #463b65
}
.dlxlink .downarrow {
    color: grey
}}
